import React from "react";
import SearchIcon from "@mui/icons-material/Search";
import KeyboardArrowDownIcon from "@mui/icons-material/KeyboardArrowDown";

function All() {
  return (
    <div className="absolute top-[55px] left-[251px] w-[1219px] p-5 justify-between text-[14px]">
      {/* All header */}
      <div className="relative flex w-full justify-between px-3 pt-1 pb-4  border-b-[1.3px] text-[15px]">
        <div className="flex">
          <span className="font-bold">전체메일</span>{" "}
          <span className="text-[#0173E5] ml-2 font-semibold">0</span>
          <span className="text-[#767678] ml-1 font-semibold"> / 163</span>
          <span className="ml-3 text-[14px] text-[#767678]">안읽음 삭제</span>
        </div>
        <div className="w-[290px] h-[30px] p-3 rounded-[15px] flex items-center bg-[#F0F1F6]">
          <input
            className="bg-[#F0F1F6] p-2 w-[190px] items-center text-[14px] h-full"
            placeholder="메일검색"
          />
          <SearchIcon
            className=" border-r-[1px] border-gray-200"
            sx={{ color: "#B7B8BD", fontSize: 20 }}
          />
          <div className="text-gray-500 ml-1 text-[13.5px] items-center">
            상세
            <KeyboardArrowDownIcon fontSize="xs" />
          </div>
        </div>
      </div>
      {/*  */}
      <div>
        <div>
          <input type="checkbox" />
        </div>
      </div>
    </div>
  );
}

export default All;
